import React from 'react';

class Register extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			email:'',
			password:'',
			passwordCheck:''
		}
	}

	register = (email, password, passwordCheck, click) => {
		if (password === passwordCheck){
			click();
		} else {
			return(<div>Passwords don't match</div>)
		}
	}

	render(){
		console.log(this.state);
		const {submitEmail, submitPassword, submitPasswordCheck, click} = this.props;
		const {email, password, passwordCheck} = this.props;
		return(
			<form className='signInForm f1 shadow-3'>
				<span className="mt3 mb4">Sign In</span>
				<input
					className='f4 ba w-80 mb2'
					type='text'
					value= {email}
					placeholder='email'
					onChange = {submitEmail}
					/>
				<input
					className='f4 ba w-80 mb2'
					type='password'
					value = {password}
					placeholder='password'
					onChange = {submitPassword}
					/>
				<input
					className='f4 ba w-80 mb3'
					type='password'
					value = {passwordCheck}
					placeholder='please retype your password'
					onChange = {submitPasswordCheck}
					/>
				<input className = 'f4 mb3' type='submit' value='Register' onClick={this.register(email, password, passwordCheck, click)}/>
			</form>
		)
	}
}


//{email, password, passwordCheck, submitEmail, submitPassword, submitPasswordCheck, click}
export default Register;
